import React, {useState} from 'react';


export default function GetGameData(data) {

    const status = getStatus(data); 

    const GameData = {
        'date': data.gdte,
        'time': data.utctm,
        'city': data.ac,
        'state': data.as,
        'home': data.hls.tn,
        'away': data.vls.tn,
        'status': status
    };

    return GameData;
}
